import './Categories.css';
import BackGround from '../UI/BackGround';

const Categories = () => {
	const category = [
		{
			id: 'e1',
			title: 'Historia',
		},
		{ id: 'e2', title: 'Matematyka' },
		{ id: 'e3', title: 'Muzyka' },
	];
	return (
		<div>
			<BackGround />
			<div class='main-cat'>
				<button id='close'>close</button>
				<label className='lbl-cat' for='chk' aria-hidden='true'>
					Kategorie
				</label>

				<button className='btn-ctg'>{category[0].title}</button>
				<button className='btn-ctg'>{category[1].title}</button>
				<button className='btn-ctg'>{category[2].title}</button>
			</div>
		</div>
	);
};

export default Categories;
